import React from "react";

function Joke(props) {
  return (
    <div>
      <p className="jokeQStyle">{"Question: " + props.content.question}</p>
      <p className="jokePStyle">{"Punchline: " + props.content.punchline}</p>
    </div>
  );
}

export default Joke;
